# Création d'un DataFrame pandas à partir des données
columns = ['ID', 'Code Projet', 'Pays', 'Secteur', 'Type Projet', 'Description', 'Montant', 'Statut', 'Date Début', 'Durée', 'Type Budget', 'Dépassement Budget']
df = pd.DataFrame(projets, columns=columns)

# Conversion de la colonne 'Date Début' en format date
df['Date Début'] = pd.to_datetime(df['Date Début'], errors='coerce')

# Création du graphe
